import React from "react";
import { StyleSheet } from "react-native";
import { SvgXml } from "react-native-svg";
import { heightPercentageToDP as hp, widthPercentageToDP as wp } from "./Responsive";

export default function MapBackground(props) {
    const background_sky = `<svg width="1084" height="1920" viewBox="0 0 1084 1920" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
    <rect width="1084" height="1927.11" fill="url(#pattern0)"/>
    <defs>
    <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
    <use xlink:href="#image0" transform="scale(0.000925926 0.000520833)"/>
    </pattern>
    <image id="image0" width="1080" height="1920" xlink:href="data:image/png;base64,"/>
    </defs>
    </svg>
    `;

    const background_forest = `<svg width="1080" height="1920" viewBox="0 0 1080 1920" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
    <rect x="-2" width="1084" height="1928.11" fill="url(#pattern0)"/>
    <defs>
    <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
    <use xlink:href="#image0" transform="scale(0.000925926 0.000520562)"/>
    </pattern>
    <image id="image0" width="1080" height="1921" xlink:href="data:image/png;base64,"/>
    </defs>
    </svg>
    `;
    const background_water = `<svg width="1080" height="1920" viewBox="0 0 1080 1920" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
    <rect x="-2" y="-4" width="1084" height="1928.9" fill="url(#pattern0)"/>
    <defs>
    <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
    <use xlink:href="#image0" transform="scale(0.000926784 0.000520833)"/>
    </pattern>
    <image id="image0" width="1079" height="1920" xlink:href="data:image/png;base64,"/>
    </defs>
    </svg>
    `;
    const background_final = `<svg width="1084" height="1920" viewBox="0 0 1084 1920" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
    <rect width="1084" height="1920" fill="url(#pattern0)"/>
    <defs>
    <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
    <use xlink:href="#image0" transform="translate(0 -0.00185185) scale(0.000925926 0.000522762)"/>
    </pattern>
    <image id="image0" width="1080" height="1920" xlink:href="data:image/png;base64,"/>
    </defs>
    </svg>
    `;

    const SkyMapSvg = () => <SvgXml xml={background_sky} style={styles.container} width={wp('100%')} height={hp('100%')} />;
    const ForestMapSvg = () => <SvgXml xml={background_forest} style={styles.container} width={wp('100%')} height={hp('100%')} />;
    const WaterMapSvg = () => <SvgXml xml={background_water} style={styles.container} width={wp('100%')} height={hp('100%')} />;
    const FinalMapSvg = () => <SvgXml xml={background_final} style={styles.container} width={wp('100%')} height={hp('100%')} />;

    switch (props.map) {
        case 'sky':
            return <SkyMapSvg />;
        case 'forest':
            return <ForestMapSvg />;
        case 'water':
            return <WaterMapSvg />;
        case 'final':
            return <FinalMapSvg />;
        default:
            return <SkyMapSvg />;
    }
}

const styles = StyleSheet.create({
    container: {
    }
})